    "id": "toolbar_formatting_paragraph_style",
    "type": "dropdown",
    "text": "Estilo de parágrafo Padrão",
    "region": "toolbar",
    "actions": ["onChange"],
    "meta": {
      "current_value": "Estilo de parágrafo Padrão"
    }
  },
  {
    "id": "toolbar_formatting_font_name",
    "type": "dropdown",
    "text": "Arial",
    "region": "toolbar",
    "actions": ["onChange"],
    "meta": {
      "current_value": "Arial"
    }
  },
  {
    "id": "toolbar_formatting_font_size",
    "type": "dropdown",
    "text": "12 pt",
    "region": "toolbar",
    "actions": ["onChange"],
    "meta": {
      "current_value": "12 pt"
    }
  },
  {
    "id": "toolbar_formatting_bold",
    "type": "icon-button",
    "text": "Negrito",
    "region": "toolbar",
    "actions": ["onClick"],
    "state": "inactive"
  },
  {
    "id": "toolbar_formatting_italic",
    "type": "icon-button",
    "text": "Itálico",
    "region": "toolbar",
    "actions": ["onClick"],
    "state": "inactive"
  },
  {
    "id": "toolbar_formatting_underline",
    "type": "icon-button",
    "text": "Sublinhado",
    "region": "toolbar",
    "actions": ["onClick"],
    "state": "inactive"
  },
  {
    "id": "toolbar_formatting_font_color",
    "type": "icon-button",
    "text": "Cor da fonte",
    "region": "toolbar",
    "actions": ["onClick"]
  },
  {
    "id": "toolbar_formatting_highlight_color",
    "type": "icon-button",
    "text": "Cor de realce",
    "region": "toolbar",
    "actions": ["onClick"]
  },
  {
    "id": "toolbar_formatting_insert_table_button",
    "type": "icon-button",
    "text": "Inserir tabela",
    "region": "toolbar",
    "actions": ["onClick"],
    "state": "active"
  },
  {
    "id": "table_insertion_popover",
    "type": "popover",
    "text": "Tabela",
    "region": "main-content",
    "state": "open",
    "meta": {
      "title": "Tabela"
    },
    "children": [
      {
        "id": "table_grid_selector",
        "type": "grid-selector",
        "text": "Seletor de tamanho de tabela",
        "region": "popover",
        "actions": ["onSelect"],
        "meta": {
          "selected_value": "4 x 4",
          "max_rows": 10,
          "max_cols": 10
        }
      },
      {
        "id": "table_grid_selected_display",
        "type": "label",
        "text": "4 x 4",
        "region": "popover",
        "meta": {
          "description": "Indica o tamanho da tabela selecionada no grid"
        }
      },
      {
        "id": "table_insertion_other_options_button",
        "type": "button",
        "text": "Outras opções...",
        "region": "popover",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "ruler_horizontal",
    "type": "ruler",
    "text": null,
    "region": "main-content",
    "meta": {
      "orientation": "horizontal"
    }
  },
  {
    "id": "document_editing_area",
    "type": "text-area",
    "text": null,
    "region": "main-content",
    "state": "focused",
    "actions": ["onInput", "onFocus"],
    "meta": {
      "placeholder": "Digite seu texto aqui..."
    }
  },
  {
    "id": "sidebar",
    "type": "sidebar",
    "text": null,
    "region": "sidebar",
    "children": [
      {
        "id": "sidebar_properties",
        "type": "icon-button",
        "text": "Propriedades",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_styles",
        "type": "icon-button",
        "text": "Estilos",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_gallery",
        "type": "icon-button",
        "text": "Galeria",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_navigator",
        "type": "icon-button",
        "text": "Navegador",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_pages",
        "type": "icon-button",
        "text": "Páginas",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_styles_and_formatting",
        "type": "icon-button",
        "text": "Estilos e Formatação",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_find_and_replace",
        "type": "icon-button",
        "text": "Localizar e Substituir",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_zoom_in",
        "type": "icon-button",
        "text": "Mais zoom",
        "region": "sidebar",
        "actions": ["onClick"]
      },
      {
        "id": "sidebar_zoom_out",
        "type": "icon-button",
        "text": "Menos zoom",
        "region": "sidebar",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "status_bar_page_info",
    "type": "label",
    "text": "Página 1 de 1",
    "region": "status-bar"
  },
  {
    "id": "status_bar_word_count",
    "type": "label",
    "text": "0 palavra, 0 caractere",
    "region": "status-bar"
  },
  {
    "id": "status_bar_page_style",
    "type": "label",
    "text": "Estilo de página Padrão",
    "region": "status-bar",
    "actions": ["onClick"]
  },
  {
    "id": "status_bar_language",
    "type": "label",
    "text": "Português (Brasil)",
    "region": "status-bar",
    "actions": ["onClick"]
  },
  {
    "id": "status_bar_zoom_slider",
    "type": "slider",
    "text": null,
    "region": "status-bar",
    "actions": ["onChange"],
    "meta": {
      "min_value": 20,
      "max_value": 600,
      "current_value": 100,
      "unit": "%"
    }
  },
  {
    "id": "status_bar_zoom_percentage",
    "type": "label",
    "text": "100%",
    "region": "status-bar"
  }
]
